from typing import List, Set
class Solution:
    def splitPainting(self, segments: List[List[int]]) -> List[List[int]]:
        cut = set()
        dict = {}
        for i in segments:
            cut.add(i[0])
            cut.add(i[1])
            if dict.get(i[0],None) == None:
                dict[i[0]] = []
            dict[i[0]].append(i)
        cut = sorted(list(cut))
        temp = []
        for i in range(1,len(cut)):
            t = dict.get(cut[i-1],None)
            if t != None:
                sum = 0
                for x in t:
                    sum+=x[2]
                    if x[1]>cut[i]:
                        if dict.get(cut[i],None) == None:
                             dict[cut[i]] = []
                        dict[cut[i]].append(x)
                temp.append([cut[i-1],cut[i],sum])
        return temp

